import React from "react";
import { useDispatch } from "react-redux";
import DropdownAction from "~/components/elements/basic/DropdownAction";
import styles from "../TableExtraStyles/extraStyles.module.css";
// import { deleteActionCategory } from "~/store/userDetails/action";
import Link from "next/link";

function UserDetailsColumn({ userDetails }) {
	const dispatch = useDispatch();
	const userDetailsDetails = userDetails.account
	
	// const deleteProduct = () => {
	//   console.log(userDetails.id)

	// 	dispatch(deleteActionCategory(userDetails.id));
	// };
	let badgeView;
	if (userDetails.auction === null) {
		badgeView = <span className="ps-badge gray">No Event</span>;
	} else if (userDetails.auction.status === "pending") {
		badgeView = <span className="ps-badge success">Ongoing</span>;
	}
	return (
		<tr>
			<td>{num + 1}</td>
			<td>
				<strong>{userDetails.name}</strong>
			</td>
			<td>{userDetails.price}</td>
			<td>{userDetails.description}</td>
			<td>{userDetails.createdAt}</td>
			<td>{badgeView}</td>
			<td>
				<Link href={"/bids/create-bid/"+userDetails.id}>
					<button className={styles.createEventButton}>Create Event</button>
				</Link>
			</td>
			<td>
				<DropdownAction type="userDetails" id={userDetails.id} key={num + 1} />
			</td>
		</tr>
	);
}

export default UserDetailsColumn;
